Cumulative_Timeserie_1.query:
q = load "${App.Datasets.MFG_Demo_Data.FullyQualifiedName}";
result = group q by ('Time_Year', 'Time_Month');
result = foreach result generate q.'Time_Year' + "~~~" + q.'Time_Month' as 'Time_Year~~~Time_Month', 'Time_Year' as 'Time_Year', 'Time_Month' as 'Time_Month', sum(q.'Actual') as 'sum_Actual', sum(q.'Plan') as 'sum_Plan';
result = group result by 'Time_Year~~~Time_Month';
result = foreach result generate 'Time_Year~~~Time_Month', first('Time_Year') as 'Time_Year', first('Time_Month') as 'Time_Month', first('sum_Actual') as 'sum_Actual', first('sum_Plan') as 'sum_Plan', sum(sum('sum_Actual')) over ([..0] partition by all order by ('Time_Year~~~Time_Month')) as 'cumm_Actual', sum(sum(sum_Plan)) over ([..0] partition by all order by ('Time_Year~~~Time_Month')) as 'cumm_Planned';
result = foreach result generate 'Time_Year~~~Time_Month', 'Time_Year', 'Time_Month', 'sum_Actual' as 'sum_Actual', 'sum_Plan' as 'sum_Plan', 'cumm_Actual' as 'cumm_Actual', 'cumm_Planned' as 'cumm_Planned';
result = fill result by (dateCols=('Time_Year','Time_Month', "Y-M"));
result = timeseries result generate 'cumm_Actual' as 'cummActual' with (length=12, predictionInterval=95, dateCols=('Time_Year','Time_Month', "Y-M"));
result = foreach result generate 'Time_Year' + "~~~" + 'Time_Month' as 'Time_Year~~~Time_Month', coalesce(cumm_Actual,cummActual) as 'Cumulative Actual Revenue', 'cummActual_low_95' as 'Min Confidence Line', 'cummActual_high_95' as 'Max Confidence Line', 'sum_Actual' as 'Actual Revenue', 'cumm_Planned' as 'Cumulative Planned Revenue';

